// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 < 0.9.0;

import '@openzeppelin/contracts/utils/Counters.sol';
import '@openzeppelin/contracts/access/Ownable.sol';

contract Sales is Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private _salesIds;

    struct SaleStruct {
        uint256 saleId;
        uint256 userId;
        string[] items;
        uint256[] prices;
    }

    mapping (uint256 => SaleStruct) public sales;

    function getSales() public view returns (SaleStruct[] memory) {
        SaleStruct[] memory salesArray = new SaleStruct[](_salesIds.current());
        for (uint256 i = 0; i < _salesIds.current(); i++) {
            SaleStruct storage sale = sales[i + 1];
            salesArray[i] = sale;
        }
        return salesArray;
    }

    function insertSale(uint256 userId, string[] memory items, uint256[] memory prices) public onlyOwner returns (uint256) {
        _salesIds.increment();
        uint256 newSaleId = _salesIds.current();
        SaleStruct memory newSale = SaleStruct(newSaleId, userId, items, prices);
        sales[newSaleId] = newSale;
        return newSaleId;
    }

    function getSaleById(uint256 saleId) public view returns (SaleStruct memory) {
        return sales[saleId];
    }

    function getSalesByUserId(uint256 userId) public view returns (SaleStruct[] memory) {
        SaleStruct[] memory salesArray = new SaleStruct[](_salesIds.current());
        uint256 count = 0;
        for (uint256 i = 0; i < _salesIds.current(); i++) {
            SaleStruct storage sale = sales[i + 1];
            if (sale.userId == userId) {
                salesArray[count] = sale;
                count++;
            }
        }
        SaleStruct[] memory result = new SaleStruct[](count);
        for (uint256 j = 0; j < count; j++) {
            result[j] = salesArray[j];
        }
        return result;
    }
}

contracts/User.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;

import '@openzeppelin/contracts/utils/Counters.sol';
import '@openzeppelin/contracts/access/Ownable.sol';

contract Users is Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private _userIds;

    struct User {
        string firstName;
        string lastName;
        uint256 amountSpent;
        uint256 userId;
    }

    mapping (uint256 => User) public users;

    function insertUser(string memory firstName, string memory lastName) public onlyOwner returns (uint256) {
        _userIds.increment();
        uint256 newUserId = _userIds.current();
        User memory newUser = User(firstName, lastName, 0, newUserId);
        users[newUserId] = newUser;
        return newUserId;
    }

    function getUsers() public view returns (User[] memory) {
        User[] memory userArray = new User[](_userIds.current());
        for (uint256 i = 0; i < _userIds.current(); i++) {
            User storage user = users[i + 1];
            userArray[i] = user;
        }
        return userArray;
    }

    function getUserId(uint256 userId) public view returns (User memory) {
        return users[userId];
    }

    function register(uint256 userId, uint256 amount) public onlyOwner {
        users[userId].amountSpent += amount;
    }
}

